    "store": {"dependencies.html":{"url":"dependencies.html","title":"package-dependencies - dependencies","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n    \n        Dependencies\n    \n    \n        \n            vue : ^3.5.13\n        \n            vue-router : ^4.5.0\n    \n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"miscellaneous/functions.html":{"url":"miscellaneous/functions.html","title":"miscellaneous-functions - functions","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n  Miscellaneous\n  Functions\n\n\n\n    Index\n    \n        \n            \n                \n                    \n                        \n                            premiumGuard   (src/.../guards.ts)\n                        \n                    \n                \n            \n        \n    \n\n\n    src/router/guards.ts\n    \n        \n        \n            \n                \n                    \n                    \n                        premiumGuard\n                        \n                    \n                \n            \n            \n                \npremiumGuard(to: RouteLocationNormalized, from: RouteLocationNormalized, next: NavigationGuardNext)\n                \n            \n\n\n\n\n            \n                \n                        گارد بررسی کلید Premium\n\nاگر key یک رشتهٔ ۸ رقمی حروف و عدد باشد پذیرفته می‌شود.\nدر غیر این صورت کاربر به روت اصلی (/) هدایت می‌شود.\n\n\n\n                            \n                                Parameters :\n                                \n                                \n                                    \n                                        \n                                            Name\n                                                Type\n                                            Optional\n                                                Description\n                                        \n                                    \n                                    \n                                        \n                                                to\n                                            \n                                                        RouteLocationNormalized\n                                            \n\n                                            \n                                                    No\n                                            \n\n\n                                            \n                                                    مقصد ناوبری\n\n                                            \n                                        \n                                        \n                                                from\n                                            \n                                                        RouteLocationNormalized\n                                            \n\n                                            \n                                                    No\n                                            \n\n\n                                            \n                                                    مبدأ ناوبری\n\n                                            \n                                        \n                                        \n                                                next\n                                            \n                                                        NavigationGuardNext\n                                            \n\n                                            \n                                                    No\n                                            \n\n\n                                            \n                                                    تابع ادامه یا ریدایرکت\n\n                                            \n                                        \n                                    \n                                \n                            \n                        \n                            Returns :         boolean\n\n                        \n                            \n                                \n                            \n                \n            \n        \n    \n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"index.html":{"url":"index.html","title":"getting-started - index","body":"\n                   \n\nvue compodoc example\nThis template should help get you started developing with Vue 3 in Vite.\nRecommended IDE Setup\nVSCode + Volar (and disable Vetur).\nType Support for .vue Imports in TS\nTypeScript cannot handle type information for .vue imports by default, so we replace the tsc CLI with vue-tsc for type checking. In editors, we need Volar to make the TypeScript language service aware of .vue types.\nCustomize configuration\nSee Vite Configuration Reference.\nProject Setup\nExample :npm installCompile and Hot-Reload for Development\nExample :npm run devType-Check, Compile and Minify for Production\nExample :npm run build\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"modules.html":{"url":"modules.html","title":"modules - modules","body":"\n                   \n\n\n\n\n    Modules\n\n\n    \n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"overview.html":{"url":"overview.html","title":"overview - overview","body":"\n                   \n\n\n\n    Overview\n\n    \n\n    \n    \n\n\n \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"properties.html":{"url":"properties.html","title":"package-properties - properties","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n    \n        Properties\n    \n    \n        \n            Version : 0.0.0\n    \n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"miscellaneous/variables.html":{"url":"miscellaneous/variables.html","title":"miscellaneous-variables - variables","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n  Miscellaneous\n  Variables\n\n\n\n    Index\n    \n        \n            \n                \n                    \n                        \n                            router   (src/.../index.ts)\n                        \n                    \n                \n            \n        \n    \n\n\n    src/router/index.ts\n    \n        \n        \n            \n                \n                    \n                    \n                        router\n                        \n                    \n                \n            \n                \n                    \n                        Default value : createRouter({\n  history: createWebHistory(import.meta.env.BASE_URL),\n  routes: [\n    {\n      path: '/',\n      name: 'home',\n      component: HomeView,\n    },\n    {\n      path: '/premium/:key',\n      name: 'premium',\n      component: PremiumView,\n      beforeEnter: [premiumGuard]\n    },\n    {\n      path: '/about',\n      name: 'about',\n      // route level code-splitting\n      // this generates a separate chunk (About.[hash].js) for this route\n      // which is lazy-loaded when the route is visited.\n      component: () => import('../views/AboutView.vue'),\n    },\n  ],\n})\n                    \n                \n\n\n        \n    \n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"}}
